import { render } from "@testing-library/react"
import ReactDOM from "react-dom";
import "./style.css";
import Block from "./Block";
ReactDOM.render(
   <div className="main">
       <div className="header">Справочник</div>
       <div className="blocks">
               <Block react="React" reacttext="React - самая популярная JavaScript-библиотека. Ежедневно ее загружают миллионы раз"/>
               <Block react="JavaScript" reacttext="JavaScript - язык программирования для создания клиентской стороны приложения"/>
               <Block react="Redux" reacttext="Redux позволяет удобным способом управлять состоянием приложения. Часто используется совместно с React"/>
       </div>
   </div>,
    document.getElementById("root")
    );
